import React,{Component} from 'react';
import{
   CardTitle,
   Card,
   Button,
   Slider,
   MediaBox,
   Media,
   Row,
   Col
} from "react-materialize";

class App extends Component {
  render(){
    return (
      <div>
        <Media>
          <MediaBox src="https://lorempixel.com/350/350/nature/1" caption="A demo media box1" width="350"/>

        </Media>


      </div>
    );
  }
}

export default App;
